import React, { useState } from 'react'
import Banner from "../components/Banner"
import Info from '../components/Info'

const HomeScreen = () => {
    
    const [logged, setLogged] = useState(true)
    
    return (
        <>
        { logged 
        ? (
            <>
                hey   
            </>
        )
        :
        (
            <>
                <Banner />
                <Info />
            </>
        )}
        </>
    )
}

export default HomeScreen
